-- Valyria Tear map editor end. Do not edit this line. Place your scripts after this line. --

function Load(m)
	Map = m;
	ObjectManager = Map.object_supervisor;
	DialogueManager = Map.dialogue_supervisor;
	EventManager = Map.event_supervisor;
	TreasureManager = Map.treasure_supervisor;
	GlobalEvents = Map.map_event_group;

	Map.unlimited_stamina = true; -- no interaction in this map

	-- This boolean determines whether we execute the initial or return scene on this map
	initial_scene = true;
	-- Global starting coordinates for the center of the group of knights. All sprites
	-- use these coordinates in determining their initial positions.
	group_start_x = 0;
	group_start_y = 0;


	-- If the river access cave map has not been visited yet, it won't register as an event group. When this is true
	-- we want to display the initial scene. Otherwise, we display the return scene.
	if (GlobalManager:DoesEventGroupExist("dat_maps_river_access_cave_lua") == false) then
		initial_scene = true;
		group_start_x = 100;
		group_start_y = 20;
	else
		initial_scene = false;
		group_start_x = 300;
		group_start_y = 24;
	end

	if (initial_scene == true) then
		-- Draw night-time scene lighting
		Map:GetEffectSupervisor():EnableLightingOverlay(hoa_video.Color(0.0, 0.0, 0.3, 0.6));
		-- Show some sandy wind
		Map:GetEffectSupervisor():EnableAmbientOverlay("img/ambient/sandstorm.png", -450.0, 25.0);
		-- Add a far storm effect
		Map:GetEffectSupervisor():EnableLightning(1, true);
		-- Add also the rain going with it
		Map:GetParticleManager():AddParticleEffect("dat/effects/particles/rain.lua", 512.0, 384.0);

		InitialCreateCharacters();
		InitialCreateNPCs();
		InitialCreateEvents();
	else
		-- Draw morning-time scene lighting
		Map:GetEffectSupervisor():EnableLightingOverlay(hoa_video.Color(0.6, 0.0, 0.3, 0.3));
		-- Show some sandy wind
		Map:GetEffectSupervisor():EnableAmbientOverlay("img/ambient/sandstorm.png", 450.0, 25.0);

		ReturnCreateCharacters();
		ReturnCreateNPCs();
		ReturnCreateDialogue();
		ReturnCreateEvents();
	end

	Map:SetCamera(claudius);

	-- This entire map is played out in scene state. As soon as the map is loaded, we start the chain of events.
	Map:PushState(hoa_map.MapMode.STATE_SCENE);
	Map:SetShowGUI(false);
	EventManager:StartEvent("Start");
end



function Update()

end


